import { BrowserRouter, Route, Routes, Navigate } from "react-router-dom";


function App() {
  return (
    <>
    <BrowserRouter>
    <Routes>
      <Route element={<Navigate to='/home' />} path='/'/>
    </Routes>
    </BrowserRouter>
    </>
  );
}

export default App;
